  List <Member> members;
  int memberId;
  string firstName;
  string lastName;
  string pass;
  string dob;
  string address;
  string city;
  string state;
  private enum MODE { None, Add, EditDelete };
  MODE mode = MODE.None;
  Member member;

  protected override async Task OnInitializedAsync() {
    await load();
  }

  protected async Task load() {
    members = await memberService.GetMembersAsync();
  }
  protected async Task Insert() {

    Member m = new Member() {
    MemberId = memberId,
    FirstName = firstName,
    LastName = lastName,
    Password = pass,
    DOB = dob,
    Address = address,
    City = city,
    State = state
  };

  await memberService.InsertMemberAsync(m);
  ClearFields();
  await load();
  mode = MODE.None;
 }
 protected void ClearFields() {
  
 
  firstName = string.Empty;
  lastName = string.Empty;
  pass = string.Empty;
  dob = string.Empty;
  city = string.Empty;
  state = string.Empty;
}
protected void Add() { 
  ClearFields();
  mode = MODE.Add;
}
protected async Task Update() {

    Member m = new Member() {
    MemberId = memberId,
    FirstName = firstName,
    LastName = lastName,
    Password = pass,
    DOB = dob,
    Address = address,
    City = city,
    State = state
  };

  await memberService.UpdateMemberAsync(memberId, m);
  ClearFields();
  await load();
  mode = MODE.None;
}

protected async Task Delete() {
  await memberService.DeleteMemberAsync(memberId);
  ClearFields();
  await load();
  mode = MODE.None;
}
protected async Task Show(int id) {
  member= await memberService.GetMembersByIdAsync(id);
  memberId = member.MemberId;
  firstName = member.FirstName;
  lastName = member.LastName;
  dob = member.DOB;
  address = member.Address;
  city = member.City;
  state = member.State;
  mode = MODE.EditDelete;
}

